    private val mockRemoteRepository = Mockito.mock<RemoteRepository>()
    private val mockSavedStateHandle = Mockito.mock<SavedStateHandle>()

    private lateinit var viewModel: CoinListViewModel


    @get:Rule
    val instantExecutorRule = InstantTaskExecutorRule()

    @Before
    fun setUp() {
        viewModel = CoinListViewModel(mockRemoteRepository,mockSavedStateHandle)
        Dispatchers.setMain(UnconfinedTestDispatcher())
    }

    @After
    fun tearDown() {
        Dispatchers.resetMain()
    }


    @Test
    fun `test getCoinList success`() = runTest{
        // Given

        val expectedData =
            Gson().fromJson(coinListExpectedResponse, CoinListResponse::class.java)
        whenever(
            mockRemoteRepository.get(CoinListResponse::class.java, AppConstants.COIN_LIST_URL)
        ).thenReturn(
            Response.success(expectedData, 200)
        )
        viewModel.getCoinList()
        // When
        val actualData = viewModel.coinListLiveData.value

        // Then
        assertEquals(Resource.Status.SUCCESS, actualData?.status)
        assertTrue(actualData?.data?.isNotEmpty()!!)

    }

    @Test
    fun `test getCoinList error`() = runTest{
        // Given

        val errorMessage = "Error Message"
        whenever(
            mockRemoteRepository.get(CoinListResponse::class.java, AppConstants.COIN_LIST_URL)
        ).thenReturn(
            Response.error(errorMessage, 404)
        )

        // When
        viewModel.getCoinList()
        val actualData = viewModel.coinListLiveData.value

        // Then
        assertEquals(Resource.Status.ERROR, actualData?.status)
        assertEquals(null, actualData?.data)
        assertEquals(errorMessage, actualData?.message)

    }
    @Test
    fun `test getCoinList empty`() = runTest{
        // Given

        val errorMessage = "No Data Found."
        whenever(
            mockRemoteRepository.get(CoinListResponse::class.java, AppConstants.COIN_LIST_URL)
        ).thenReturn(
            Response.success(null, 200)
        )

        // When
        viewModel.getCoinList()
        val actualData = viewModel.coinListLiveData.value

        // Then
        assertEquals(Resource.Status.EMPTY, actualData?.status)
        assertEquals(null, actualData?.data)
        assertEquals(errorMessage, actualData?.message)

    }


